import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)
import {isLogin, logOut} from "@/red/authMethods";

export default new Vuex.Store({
    state: {},
    getters: {
        isLogin() {
            return isLogin()
        }
    },
    mutations: {},
    actions: {},
    modules: {}
})
